INSERT INTO `HOSPITAL` VALUES (7816, '지역응급의료센터 강동경희대학교의대병원', '서울특별시 강동구 상일동', '강동가톨릭정형외과의원은 강동구 천호동 구천면로 233 2층에 자리하고 있으며 천호역 5번 출구에서 도보 12분 거리에 있습니다. 천호동성당 맞은 편이고 유명한 천호동 냉면골목 부근입니다. 강동가톨릭정형외과의원은 서울성모병원 정형외과 외래교수 출신인 정형외과 전문의 민형기 대표원장이 성심껏 진료합니다.', 1);
INSERT INTO `HOSPITAL` VALUES (7817, '지역응급의료센터 강북삼성병원', '서울특별시 종로구 평동', '빠르게 치료하기보다 바르게 치료하는 강북보아스이비인후과 입니다. 이비인후과전문의 대표원장님(유럽수면학회 수면전문가 인증의)과 이비인후과전문의 2인이 협력하여  진료하고 있습니다 .(귀 코 목 진료 /수면다원검사/양압기처방/보청기/장애진단/갑상선 초음파/CT 촬영/수액치료 )-방문접수/인터넷접수', 1);
INSERT INTO `HOSPITAL` VALUES (7818, '응급실운영신고기관 강북으뜸병원', '서울특별시 강북구 미아동', '24시간 진료 정형외과 수술가능(골절 수지접합등)', 1);
INSERT INTO `HOSPITAL` VALUES (7819, '지역응급의료센터 건국대학교병원', '서울특별시 광진구 화양동', '건강제일의료소비자생활협동조합', 1);
INSERT INTO `HOSPITAL` VALUES (7820, '지역응급의료기관 경찰병원', '서울특별시 송파구 가락동', '보건복지부 지정 추나요법 시범사업기관입니다. 침 한약 추나 면역약침등의 한의학적 치료방법을 이용하여 환자의 질병상태들 진단하고 치료합니다.', 1);
INSERT INTO `HOSPITAL` VALUES (7821, '지역응급의료센터 경희대학교병원', '서울특별시 동대문구 회기동', '서울대입구역 2번 출구 100 미터 이내입니다 . 지하2층에 주차장 있읍니다 .', 1);
INSERT INTO `HOSPITAL` VALUES (7822, '권역응급의료센터 고려대학교의과대학부속구로병원', '서울특별시 구로구 구로동', '고려고든정외과는 서울시 금천구 시흥사거리  신한은행4층에 위치하고 있으며 항시 정형외과 전문의가 상주하고 있습니다 입원실 운영하며 산재자보 의보 의료보호 등 모든진료가 가능한 병원입니다', 1);
INSERT INTO `HOSPITAL` VALUES (7823, '지역응급의료기관 구로성심병원', '서울특별시 구로구 고척동', '안녕하세요? 최고의 치료가 될 수 있도록 최선을 다하는 구대한의원입니다. 머리떨림 틱장애 파킨슨병 디스크 등의 질환을 치료합니다.', 1);
INSERT INTO `HOSPITAL` VALUES (7824, '국립중앙의료원', '서울특별시 중구 을지로6가', '외래 30분전 접수마감/토요일은 일부과만 진료하며 진료과 사정상 토요진료가 어려울 수 있으니 안내전화로 문의 후 내원하시기 바랍니다.  ☎ 1588-1775(ARS 안내)', 1);
INSERT INTO `HOSPITAL` VALUES (7825, '지역응급의료센터 노원을지대학교병원', '서울특별시 노원구 하계동', '일반진료/미용성형/봉합/', 1);
