-- ----------------------------
-- View structure for RESERVE_REPORT
-- ----------------------------
DROP VIEW IF EXISTS `RESERVE_REPORT`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `RESERVE_REPORT` AS select `R`.`id` AS `id`,`R`.`vaccine_type` AS `vaccine_type`,`V`.`report_type` AS `report_type` from (`RESERVATION` `R` join `VACC_REPORT` `V`) where `R`.`id` = `V`.`reserve_id`;

-- ----------------------------
-- View structure for USER_VACCINATED
-- ----------------------------
DROP VIEW IF EXISTS `USER_VACCINATED`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `USER_VACCINATED` AS select distinct `U`.`uid` AS `uid`,`U`.`legal_name` AS `legal_name`,`U`.`sex` AS `sex`,`U`.`birthdate` AS `birthdate`,`R`.`vaccine_type` AS `vaccine_type`,case when max(`R`.`current_series`) = `V`.`series` then 'FULL' when max(`R`.`current_series`) > 0 then 'PARTIAL' else 'NO' end AS `Vaccinated` from ((`USER` `U` left join `RESERVATION` `R` on(`U`.`uid` = `R`.`uid` and `R`.`is_complete` = 1)) left join `VACCINE` `V` on(`R`.`vaccine_type` = `V`.`id`)) group by `U`.`uid`;

-- ----------------------------
-- Procedure structure for CheckVaccinated
-- ----------------------------
DROP PROCEDURE IF EXISTS `CheckVaccinated`;
delimiter ;;
CREATE PROCEDURE `CheckVaccinated`(IN in_uid INT)
BEGIN
	#Routine body goes here...
	SELECT IF(count(*) >= 1, True, False) AS Vaccinated FROM RESERVATION where uid = in_uid AND is_complete = 1;
END
;;
delimiter ;

