DROP TRIGGER IF EXISTS `automated_email_auth_add`;
delimiter ;;
CREATE TRIGGER `automated_email_auth_add` AFTER INSERT ON `USER` FOR EACH ROW BEGIN
    SELECT LEFT (UUID(), 16) INTO @authRandom;
    INSERT EMAIL_AUTH VALUE (NULL, NEW.email, @authRandom, 0);
	END
;;
